import React from 'react'




const loginScreen = () => {
  return (
    <KeyboardAvoidingView
      style={styles.container}
      behavior="padding"
    >
      <Text>loginScreen</Text>



      
    </KeyboardAvoidingView>
  )
}

export default loginScreen

const styles = StyleSheet.create({})
